import React, { useState, useEffect } from 'react';
import '../styles/clubs.css';

function Clubs() {
  const [teamsData, setTeamsData] = useState({});

  useEffect(() => {
    fetch('http://127.0.0.1:5000/teams')
      .then(response => response.json())
      .then(data => {
        console.log('Fetched data:', data); // Debugging to see fetched data structure
        setTeamsData(data);
      })
      .catch(error => console.error('Error:', error));
  }, []);

  return (
    <div className="clubs-container">
      <header className="header">
        <h1>League Information</h1>
        <p>All the info above</p>
      </header>
      <div className="teams-grid">
        {Object.keys(teamsData).map(league => (
          <React.Fragment key={league}>
            <h2>{league}</h2>
            <div className="teams-row">
              {Object.keys(teamsData[league].teams).map(teamName => {
                const team = teamsData[league].teams[teamName];
                return (
                  <div className="team-card" key={team.id}>
                    <img src={team.crest} alt={teamName} />
                    <h3>{teamName}</h3>
                    <p>Coach: {team.coach}</p>
                    <p>Founded: {team.founded}</p>
                    <p>Venue: {team.venue}</p>
                    <a href={team.website} target="_blank" rel="noopener noreferrer">Website</a>
                  </div>
                );
              })}
            </div>
          </React.Fragment>
        ))}
      </div>
    </div>
  );
}

export default Clubs;
